// Combine all posts into one array for display
const allPosts = [...allPosts1, ...allPosts2, ...allPosts3, ...allPosts4, ...allPosts5, ...allPosts6, ...allPosts7, ...allPosts8];

// Configuration
const config = {
    postsPerPage: 10,
    defaultPage: 1,
    downloadEnabled: false,
    isLoading: false
};

// State
const state = {
    currentPage: config.defaultPage,
    currentTag: "",
    filteredPosts: [...allPosts]
};

// Initialize Toastr
toastr.options = {
    closeButton: true,
    progressBar: true,
    positionClass: "toast-top-right",
    timeOut: 5000
};

// DOM Elements
const elements = {
    postContainer: document.getElementById('post-container'),
    pagination: document.getElementById('pagination'),
    tagFilter: document.getElementById('tag-filter'),
    searchInput: document.getElementById('search'),
    searchBtn: document.getElementById('search-btn'),
    toggleDownloadBtn: document.getElementById('toggle-download-btn'),
    backToTopBtn: document.getElementById('backToTop')
};

// Initialize the page
function init() {
    setupEventListeners();
    populateTags();
    getParamsFromURL();
    filterPosts();
    displayPosts();
    
    // Show welcome message when page is loaded
    toastr.success('Welcome to MovieHai!', 'Enjoy our collection');
}


// Set up event listeners
function setupEventListeners() {
    elements.toggleDownloadBtn.addEventListener('click', toggleDownload);
    elements.searchBtn.addEventListener('click', searchPosts);
    elements.searchInput.addEventListener('keyup', (e) => {
        if (e.key === 'Enter') searchPosts();
    });
    elements.tagFilter.addEventListener('change', () => filterByTag());
    
    window.addEventListener('scroll', () => {
        if (window.scrollY > 300) {
            elements.backToTopBtn.classList.add('active');
        } else {
            elements.backToTopBtn.classList.remove('active');
        }
    });
    
    elements.backToTopBtn.addEventListener('click', () => {
        window.scrollTo({ top: 0, behavior: 'smooth' });
    });
}

// Populate tags dropdown
function populateTags() {
    const tags = new Set();
    allPosts.forEach(post => {
        post.tags.forEach(tag => {
            tags.add(tag);
        });
    });
    
    elements.tagFilter.innerHTML = '<option value="">All Tags</option>';
    Array.from(tags).sort().forEach(tag => {
        const option = document.createElement('option');
        option.value = tag;
        option.textContent = tag;
        elements.tagFilter.appendChild(option);
    });
}

// Filter posts based on current tag and search
function filterPosts() {
    let filtered = [...allPosts];
    
    // Filter by tag
    if (state.currentTag) {
        filtered = filtered.filter(post => 
            post.tags.includes(state.currentTag)
        );
    }
    
    // Filter by search term
    const searchTerm = elements.searchInput.value.toLowerCase();
    if (searchTerm) {
        filtered = filtered.filter(post => 
            post.title.toLowerCase().includes(searchTerm) || 
            post.tags.some(tag => tag.toLowerCase().includes(searchTerm))
        );
    }
    
    state.filteredPosts = filtered;
    state.currentPage = config.defaultPage;
}

// Display posts in the container
function displayPosts() {
    if (config.isLoading) return;
    config.isLoading = true;
    
    const start = (state.currentPage - 1) * config.postsPerPage;
    const end = start + config.postsPerPage;
    const postsToShow = state.filteredPosts.slice(start, end);
    
    elements.postContainer.innerHTML = '';
    
    if (postsToShow.length === 0) {
        showNoResults();
        config.isLoading = false;
        return;
    }
    
    postsToShow.forEach((post, index) => {
        const postElement = createPostElement(post, index);
        elements.postContainer.appendChild(postElement);
    });
    
    displayPagination();
    updateURL();
    config.isLoading = false;
}

// Create a single post element
function createPostElement(post, index) {
    const colDiv = document.createElement('div');
    colDiv.className = 'col';
    colDiv.setAttribute('data-aos', 'fade-up');
    colDiv.setAttribute('data-aos-delay', (index % 5) * 100);
    
    colDiv.innerHTML = `
        <div class="post">
            <img src="${post.img}" alt="${post.title}" 
                 data-lightbox="post-${index}"
                 data-title="${post.title}">
            <h2>${post.title} 480p, 720p, 1080p Download Glinks</h2>
            <button class="btn btn-primary watch-btn">
                <i class="fas fa-play me-2"></i>Watch Now
            </button>
            ${config.downloadEnabled ? `
            <button class="btn btn-success download-btn">
                <i class="fas fa-download me-2"></i>Download
            </button>` : ''}
            <p class="tags">Tags: ${post.tags.map(tag => 
                `<span>${tag}</span>`).join(", ")}</p>
        </div>
    `;
    
    // Add event listeners
    colDiv.querySelector('h2').addEventListener('click', () => openPost(post));
    colDiv.querySelector('.watch-btn').addEventListener('click', () => openPost(post));
    
    if (config.downloadEnabled) {
        colDiv.querySelector('.download-btn').addEventListener('click', 
            () => downloadPost(post.title));
    }
    
    colDiv.querySelectorAll('.tags span').forEach(span => {
        span.addEventListener('click', () => filterByTag(span.textContent));
    });
    
    return colDiv;
}

// Show no results message
function showNoResults() {
    elements.postContainer.innerHTML = `
        <div class="col-12 text-center py-5" data-aos="fade-up">
            <i class="fas fa-film fa-3x mb-3" style="opacity: 0.5;"></i>
            <h3>No posts found</h3>
            <p>Try adjusting your search or filter criteria</p>
            <button class="btn btn-primary mt-3" id="reset-filters-btn">
                <i class="fas fa-sync-alt me-2"></i>Reset Filters
            </button>
        </div>
    `;
    
    document.getElementById('reset-filters-btn').addEventListener('click', resetFilters);
}

// Display pagination controls
function displayPagination() {
    const totalPages = Math.ceil(state.filteredPosts.length / config.postsPerPage);
    elements.pagination.innerHTML = '';
    
    // Previous Button
    if (state.currentPage > 1) {
        const prevBtn = createPaginationButton('Previous', () => 
            goToPage(state.currentPage - 1));
        elements.pagination.appendChild(prevBtn);
    }
    
    // Page Numbers
    const startPage = Math.max(1, state.currentPage - 1);
    const endPage = Math.min(totalPages, state.currentPage + 1);
    
    for (let i = startPage; i <= endPage; i++) {
        const pageBtn = createPaginationButton(i, () => goToPage(i));
        if (i === state.currentPage) {
            pageBtn.classList.add('active');
        }
        elements.pagination.appendChild(pageBtn);
    }
    
    // Next Button
    if (state.currentPage < totalPages) {
        const nextBtn = createPaginationButton('Next', () => 
            goToPage(state.currentPage + 1));
        elements.pagination.appendChild(nextBtn);
    }
}

// Create a pagination button
function createPaginationButton(text, onClick) {
    const button = document.createElement('button');
    button.className = 'btn btn-primary mx-1';
    button.textContent = text;
    button.addEventListener('click', onClick);
    return button;
}

// Filter by tag
function filterByTag(tag = '') {
    state.currentTag = tag || elements.tagFilter.value;
    filterPosts();
    displayPosts();
    
    if (state.currentTag) {
        toastr.info(`Showing posts tagged with: ${state.currentTag}`);
    }
}

// Search posts
function searchPosts() {
    filterPosts();
    displayPosts();
    
    if (elements.searchInput.value) {
        toastr.info(`Found ${state.filteredPosts.length} matching posts`);
    }
}

// Reset all filters
function resetFilters() {
    elements.tagFilter.value = '';
    elements.searchInput.value = '';
    state.currentTag = '';
    filterPosts();
    displayPosts();
    toastr.info('All filters have been reset');
}

// Go to specific page
function goToPage(page) {
    state.currentPage = page;
    displayPosts();
    window.scrollTo({ top: 0, behavior: 'smooth' });
}

// Open post in new tab with server-specific URL
function openPost(post) {
    const btn = event.target.closest('.btn') || event.target;
    if (btn) btn.classList.add('btn-loading');
    
    setTimeout(() => {
        const formattedTitle = post.title
            .replace(/\s*[({]\s*/g, '-')
            .replace(/\s*[)}]\s*/g, '-')
            .replace(/\s+/g, '-')
            .replace(/-+/g, '-')
            .replace(/-$/, '');
            
        // Determine which server to use based on which array the post belongs to
        let serverUrl = "https://www.moviehai.icu/p/";
        if (allPosts2.includes(post)) serverUrl = "https://p2.moviehai.icu/p/";
        else if (allPosts3.includes(post)) serverUrl = "https://p3.moviehai.icu/p/";
        else if (allPosts4.includes(post)) serverUrl = "https://p4.moviehai.icu/p/";
        else if (allPosts5.includes(post)) serverUrl = "https://p5.moviehai.icu/p/";
        else if (allPosts6.includes(post)) serverUrl = "https://p6.moviehai.icu/p/";
        else if (allPosts7.includes(post)) serverUrl = "https://p7.moviehai.icu/p/";
        else if (allPosts8.includes(post)) serverUrl = "https://p8.moviehai.icu/p/";
            
        window.open(`${serverUrl}${formattedTitle}.html`, '_blank');
        
        if (btn) setTimeout(() => btn.classList.remove('btn-loading'), 1000);
    }, 300);
}


// Download post
function downloadPost(title) {
    if (!config.downloadEnabled) {
        toastr.warning('Please enable downloads first');
        return;
    }
    
    const btn = event.target.closest('.btn') || event.target;
    btn.classList.add('btn-loading');
    
    toastr.info(`Preparing download for: ${title}`);
    
    setTimeout(() => {
        const formattedTitle = title.replace(/\s+/g, '-');
        window.open(`/p/${formattedTitle}`, '_blank');
        setTimeout(() => btn.classList.remove('btn-loading'), 1000);
    }, 500);
}

// Toggle download feature
function toggleDownload() {
    config.downloadEnabled = !config.downloadEnabled;
    elements.toggleDownloadBtn.textContent = 
        config.downloadEnabled ? "Disable Download" : "Enable Download";
    displayPosts();
    
    toastr.success(
        `Downloads ${config.downloadEnabled ? 'enabled' : 'disabled'}`,
        config.downloadEnabled ? 'Success' : 'Info'
    );
}

// Update URL with current state
function updateURL() {
    const params = new URLSearchParams();
    if (state.currentTag) params.set("tag", state.currentTag);
    if (state.currentPage > 1) params.set("page", state.currentPage);
    window.history.replaceState(null, "", `?${params.toString()}`);
}

// Get parameters from URL
function getParamsFromURL() {
    const params = new URLSearchParams(window.location.search);
    state.currentTag = params.get("tag") || "";
    state.currentPage = params.get("page") ? parseInt(params.get("page")) : config.defaultPage;
    
    if (state.currentTag) {
        elements.tagFilter.value = state.currentTag;
    }
}

// Initialize Lightbox
lightbox.option({
    resizeDuration: 200,
    wrapAround: true,
    alwaysShowNavOnTouchDevices: true
});

// Start the application
init();

